/**
 * Main Application Component
 * 
 * Sets up the application routing structure:
 * - Public routes (home, listings, auth)
 * - Protected routes (dashboard, bookings)
 * - Wraps all routes in a common layout
 */

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import HomePage from './pages/HomePage';
import { ListingsPage } from './pages/ListingsPage';
import ListingDetailPage from './pages/ListingDetailPage';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import UserDashboardPage from './pages/UserDashboardPage';
import AgentDashboardPage from './pages/AgentDashboardPage';
import BookingManagementPage from './pages/BookingManagementPage';

function App() {
  return (
    <Router>
      <Layout>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/listings" element={<ListingsPage />} />
          <Route path="/listings/:id" element={<ListingDetailPage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignupPage />} />
          <Route path="/dashboard" element={<UserDashboardPage />} />
          <Route path="/dashboard/agent" element={<AgentDashboardPage />} />
          <Route path="/dashboard/bookings" element={<BookingManagementPage />} />
        </Routes>
      </Layout>
    </Router>
  );
}

export default App;
